import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    menuContainer: {
        position: 'absolute',
        width: 250,
        height: 600,
        backgroundColor: '#FFF',
        transform: 'translateX(-100%)',
        '-webkit-transform': 'translateX(-100%)'
    }
}))

export default useStyles
